import React, { Component } from 'react';

class Contact extends Component {
  render(){
    return(
      <div className="container mt-4">
        <h1>Contact</h1>
        <p>Hi, I'm Yu Ohno who works in nantoka-japan support team.</p>
      </div>
    )
  }
}
export default Contact;
